import React from 'react';

import './Times.css';

export default function Times(props) {
    const { handleTime } = props;
    const timeSlots = ["06:00-09:00","09:00-12:00", "12:00-15:00" ]
    return (
        <div>
            <div onClick={(e) => handleTime(e, "06:00-09:00")} className="time-slot">06:00-09:00</div>
            <div onClick={(e) => handleTime(e, "09:00-12:00")} className="time-slot">09:00-12:00</div>
            <div onClick={(e) => handleTime(e, "12:00-15:00")} className="time-slot">12:00-15:00</div>
            <div onClick={(e) => handleTime(e, "15:00-18:00")} className="time-slot">15:00-18:00</div>
        </div>
    )
}
